lexer :: (Token -> P a) -> P a
lexer cont s = case alexScan ('\0',s) 0 of
                 AlexEOF                  -> cont TokEOF ""
                 AlexError _              -> \l c -> (FailP ("line " ++ show l ++ " column " ++ show c ++ ": unrecognizable token")) 
                 AlexSkip  (_,s') len     -> \l c -> lexer cont s' l (fst3' c + snd3' c, trd3' c, len)
